								int ivarseq3 = System.Convert.ToInt32(varseq3);
								int ivarseq4 = System.Convert.ToInt32(varseq4);
								int ivarseq5 = System.Convert.ToInt32(varseq5);
								int ivarseq6 = System.Convert.ToInt32(varseq6);
								int ivarseq7 = System.Convert.ToInt32(varseq7);
								int ivarseq8 = System.Convert.ToInt32(varseq8);
								int ivarseq9 = System.Convert.ToInt32(varseq9);
								int ivarseq10 = System.Convert.ToInt32(varseq10);
								int ivarseq11 = System.Convert.ToInt32(varseq11);
								int ivarseq12 = System.Convert.ToInt32(varseq12);

							if( ivarseq1 < 13 && ivarseq1 != 0)
							{
								seg1 = Inputs.var_smartstring.Value.Entry(ivarseq1-1, "|") + varsepchar;
							}
							
							if( ivarseq2 < 13 && ivarseq2 != 0)
							{
								seg2 = Inputs.var_smartstring.Value.Entry(ivarseq2-1, "|") + varsepchar;
							}
							
							if( ivarseq3 < 13 && ivarseq4 != 0)
							{
								seg3 = Inputs.var_smartstring.Value.Entry(ivarseq3-1, "|") + varsepchar;
							}
							
							if( ivarseq4 < 13 && ivarseq4 != 0)
							{
								seg4 = Inputs.var_smartstring.Value.Entry(ivarseq4-1, "|") + varsepchar;
							}
							
							if( ivarseq5 < 13 && ivarseq5 != 0)
							{
								seg5 = Inputs.var_smartstring.Value.Entry(ivarseq5-1, "|") + varsepchar;
							}
							
							if( ivarseq6 < 13 && ivarseq6 != 0)
							{
								seg6 = Inputs.var_smartstring.Value.Entry(ivarseq6-1, "|") + varsepchar;
							}
							
							if( ivarseq7 < 13 && ivarseq7 != 0)
							{
								seg7 = Inputs.var_smartstring.Value.Entry(ivarseq7-1, "|") + varsepchar;
							}
							
							if( ivarseq8 < 13 && ivarseq8 != 0)
							{
								seg8 = Inputs.var_smartstring.Value.Entry(ivarseq8-1, "|") + varsepchar;
							}
							
							if( ivarseq9 < 13 && ivarseq9 != 0)
							{
								seg9 = Inputs.var_smartstring.Value.Entry(ivarseq9-1, "|") + varsepchar;
							}
							
							if( ivarseq10 < 13 && ivarseq10 != 0)
							{
								seg10 = Inputs.var_smartstring.Value.Entry(ivarseq10-1, "|") + varsepchar;
							}
							
							if( ivarseq11 < 13 && ivarseq11 != 0)
							{
								seg11 = Inputs.var_smartstring.Value.Entry(ivarseq11-1, "|") + varsepchar;
							}
							
							if( ivarseq12 < 13 && ivarseq12 != 0)
							{
								seg12 = Inputs.var_smartstring.Value.Entry(ivarseq12-1, "|") + varsepchar;
							}

                string custskucalc = "";
                custskucalc = seg1 + seg2 + seg3 + seg4 + seg5 + seg6 + seg7 + seg8 + seg9 + seg10 + seg11 + seg12;


                /* Verification that the xpart num does not exceed 50 characters */
                if ( custskucalc.Length <= 50)
                {
                    //Inputs.var_custsku.Value = Substring(custskucalc, 1, length(custskucalc) - 1);
										Inputs.var_custsku.Value = custskucalc.Substring(0, custskucalc.Length - 1);
                    custskudesc = Inputs.var_fgdesc.Value;
                    Inputs.var_udxpartnum.Value = Inputs.var_custsku.Value;
                }

                if (custskucalc.Length > 50 && Inputs.chk_erroron.Value == true && Inputs.chk_ackconfirm.Value == false)
                {
                    Inputs.var_custsku.Value = "";
                    Inputs.var_ackrqd.Value = true;

										MessageBox.Show("The calculated customer part cross reference number for this configuration exceeds the allowed number of characters. To prevent any errors from occurring the configurator will not attempt to populate the customer part cross reference field. Please enter the relevant part reference manually in the demand Line.", "Note", MessageBoxButtons.OK,  MessageBoxIcon.Information);
										PageLeaveFunctions.SetNextInputPage(1);
										Args.Cancel = true;

                }
            }

            /* Returns any specific Barcode Customer Part Cross References */
            Inputs.var_upc12.Value = PCLookUp.DataLookup(Inputs.var_custid.Value.ToString(), "UPC-12", Inputs.var_smart2.Value);
