								PageLeaveFunctions.SetNextInputPage(1);
								Args.Cancel = true;
            }

            /* ******************************************************************************************************************************* */

            /* Ensures the user has verified acknowledgement of any exception messages */

            if ((Inputs.var_ackrqd.Value == true) && (Inputs.chk_erroron.Value == true))
            {

                if (Inputs.chk_ackconfirm.Value == false)
                {

										MessageBox.Show("The configurator requires acknowledgement of a message condition prior to allowing the configuration to proceed. Please tick the checkbox labelled Acknowledge Message prior to leaving the page.", "Note", MessageBoxButtons.OK,  MessageBoxIcon.Information);
										PageLeaveFunctions.SetNextInputPage(1);
										Args.Cancel = true;

                }
            }

            /* ******************************************************************************************************************************* */

            /* Output required for Webbing PO Suggestion Buying Advisory Report */

            /* If configuration utilises Cut length webbing then determine if it should be sewn based on the chosen Tape End. */
            /* TRUE refers to webbing should NOT be sewn */
            /* This output will be used in the relevant BAQ and Crystal report */

            Inputs.var_cutwebsewwarn.Value = false;

            if ((Inputs.var_webpartnum.Value != "") && (Inputs.cmb_webformat.Value == "CUT"))
            {
                if (Inputs.var_smartcodetapeend.Value == "P") { Inputs.var_cutwebsewwarn.Value = true; }
                if (Inputs.var_smartcodetapeend.Value == "W") { Inputs.var_cutwebsewwarn.Value = true; }
                if (Inputs.var_smartcodetapeend.Value == "O") { Inputs.var_cutwebsewwarn.Value = true; }
                if (Inputs.var_smartcodetapeend.Value == "WO") { Inputs.var_cutwebsewwarn.Value = true; }
            }

            /* ******************************************************************************************************************************* */


            /* Configuration Notes */

            string Note1 = "";
            string Note2 = "";
            string Note3 = "";

            /* Rockite and Socket Keys for Removable bases */
            Note1 = PCLookUp.DataLookup("TBPBaseRange", "note_ref", Inputs.cmb_baseselection.Value);


            if (Note1 != "") { Inputs.var_note1.Value = Note1; }
            if (Note2 != "") { Inputs.var_note1.Value = Note2; }
            if (Note3 != "") { Inputs.var_note1.Value = Note3; }

            if (Note1 == "") { Inputs.var_note1.Value = ""; }
            if (Note2 == "") { Inputs.var_note2.Value = ""; }
            if (Note3 == "") { Inputs.var_note3.Value = ""; }

